import bootstrap from "bootstrap";
import 'react-bootstrap';
import Form from "react-bootstrap/Form";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container } from "react-bootstrap";

function form() {
    return(
    <>
    <Container>
    <Form.Label htmlFor="inputuser">
        Username
    </Form.Label>
    <Form.Control
        type="text"
        id="inputuser"
    /> 
    </Container>   
    </>
    );
}
export default form
